import React from 'react';


import StickyNav from 'react-js-stickynav'
import 'react-js-stickynav/dist/index.css'
import logo1 from './images/logo1.svg' ;
import { Route } from 'react-router-dom';
import Welcome from './pages/Welcome';
import Products from './pages/Products';
import MainHeader from './components/mainpage/MainHeader';
import MainHeader2 from './components/mainpage/MainHeader2';
import platinum from './images/midtown-grey.svg' ;
import titanium from './images/nova-light-grey-shaker.svg' ;
import gold from './images/ice-white-shaker.svg' ;
import silver from './images/silver-collection001.svg' ;
import mask1 from './images/Maskgroup1.svg' ;
import mask2 from './images/Maskgroup2.svg' ;
import mask3 from './images/Maskgroup3.svg' ;
import mask4 from './images/Maskgroup4.svg' ;
import Group6 from './images/Group6.svg' ;

import { Col, Row, Navbar, Nav, Modal, OverlayTrigger, Tooltip } from "react-bootstrap";
import './footer.css';
import './image.css';
import './center.css';
import './middleslide.css';


const App = () => {
  const style = () => {
    return (
      <style jsx>{`
        .nav {
          transition: all 0.1s linear;
          position: fixed;
          z-index: 2000;
          padding: 1%;
          width: 100%;
          text-align:center;
          height:20%;
          opacity: 0.8;
          background-color:#4e5157;
        }
        .scrollNav {
          transition: all 0.5s ease-in;
          z-index: 2000;
          background: #ffffff;
          width: 100%;
          border-bottom: 1px solid #dddddd;
        }
        .styl {
          padding-top: 80px;
        }
        @media(max-width: 400px){
          .nav {
            height:10.0%;
            padding: 1%;
            width: 100%;
                 }
        }
      `}</style>
    )
  }
  return (
    <div>
      {style()}

         <div className="container">
         <Navbar collapseOnSelect fixed="top" expand="lg" >

<Navbar.Brand></Navbar.Brand>
<Navbar.Toggle aria-controls="responsive-navbar-nav" />

<Navbar.Collapse id="responsive-navbar-nav" >

  {/*this.state.isAuthenticated ? (*/}
  <Nav className="me-auto">
    <Nav.Item><Nav.Link href="#home" style={{ width: 80 }}>Home</Nav.Link></Nav.Item>
    <Nav.Item><Nav.Link href="#vision" style={{ width: 140 }}>Our Vision</Nav.Link></Nav.Item>
    <Nav.Item><Nav.Link href="#howItWorks" style={{ width: 140 }}>How It Works</Nav.Link></Nav.Item>
    {/*<Nav.Item><Nav.Link href="#roadmap" style={{ width: 120 }}>Roadmap</Nav.Link></Nav.Item>*/}
    <Nav.Item><Nav.Link href="#community" style={{ width: 140 }}>Community</Nav.Link></Nav.Item>
    <Nav.Item><Nav.Link target="_blank" href="mailto:team@hnwcoin.com" style={{ width: 140 }}>Contact Us</Nav.Link></Nav.Item>
  </Nav>
  <Nav >
    <div className="pw">
      <img alt="Presale" style={{ cursor: "pointer" }} src={presaleBtn} onClick={handleShow} width="200px" /><br />
      <a href="HNW_Whitepaper.pdf" target="_blank"><img alt="Whitepaper" src={whitepaperMobileBtn} style={{ marginLeft: 48, cursor: "pointer", marginTop: -25 }} width="150px" /></a>
    </div>
  </Nav>

</Navbar.Collapse>
</Navbar>


      <img className='img' src={logo1} />
      <div className='center'>Our Commitment<br/>to Quality</div>
      <div className='center2'>We offer Ready to Assemble (RTA) cabinets that are KCMA certified.<br/> KCMA certified cabinets are recognized in the marketplace as a <br/>quality product able to perform after a rigorous battery to tests<br/> simulating years of household use.</div>
      <div className='center3'>BROWSE OUR CABINES</div>
 </div>

 <div className='row'>
 <div className='separator'>
  <div className='line'></div>
  <h2>OUR COLLECTIONS</h2>
  <div className='line'></div>

</div>




</div>



<div className='row2'>

  <div className='column2' >
     <div className='row3'>
       <div className='column3'>
          <a href="#" target="_blank" rel="noreferrer">
            <img className='img12' src={mask1} />
          </a>  

          <a href="#" target="_blank" rel="noreferrer">
            <img className='img2' src={mask2} />
          </a>  

    </div>
  <div className='column3' >
    <a href="#" target="_blank" rel="noreferrer">
            <img className='img3' src={mask3} />
          </a>  

          <a href="#" target="_blank" rel="noreferrer">
            <img className='img13' src={mask4} />
          </a>  

  </div>
</div>



  </div>
  <div className='column2' >
